import React from 'react';

const Card = () => {
    return (
        <div>
            <h1>Robot</h1>
            <img alt='robot' src='https://robohash.org/test?200X200' />
            <div>
                <h2>Jane Doe</h2>
                <p>janedoe@gmail.com</p>
            </div>
        </div>
    );
}

export default Card;
